import React, { Component } from 'react';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import {Nav,Navbar} from 'react-bootstrap/Button';

import MenuIcon from '@material-ui/icons/Menu';
import { IconButton,} from '@material-ui/core';


class NavbarComps extends Component {

    menuState={
        anchorEl:null,
        setAnchorEl:null
    }

   handleClick = (event) => {
       this.setState({ setAnchorEl:event.currentTarget});
      };
    
     handleClose = () => {

        this.setState({ setAnchorEl:null});
      };

    render() {
        return (
            <div>
                <Navbar bg="light" expand="lg">
                             <Navbar.Brand href="#home">EGBA SİSTEM</Navbar.Brand>
                                 <Navbar.Toggle aria-controls="basic-navbar-nav" />
             <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
     
      <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    
  </Navbar.Collapse>
</Navbar>
                
                    <AppBar position="static">
                        <Toolbar class="navbar navbar-dark bg-dark">
                            
                            <Typography variant="h6" >EGBA SİSTEM
                              
                            </Typography>
                            <IconButton edge="end"  color="inherit" aria-label="menu">
                                <MenuIcon onClick={this.handleClick} />
                            </IconButton>
                           
                            
                        </Toolbar>
                    </AppBar>
                   
                    
                
            </div>
        )
    }
}
export default NavbarComps;
